import logo from './logo.svg';
import './App.css';

function Board(){

  return(
    <div className='board'>
      <div className='boardLine'>
        <Square value="0"></Square>
        <Square value="1"></Square>
        <Square value="2"></Square>
        <Square value="3"></Square>
        <Square value="4"></Square>
        <Square value="5"></Square>
        <Square value="6"></Square>
      </div>
      <div className='boardLine'>
        <Square value="7"></Square>
        <Square value="8"></Square>
        <Square value="9"></Square>
        <Square value="10"></Square>
        <Square value="11"></Square>
        <Square value="12"></Square>
        <Square value="13"></Square>
      </div>
      <div className='boardLine'>
        <Square value="14"></Square>
        <Square value="15"></Square>
        <EmpoweredSquare value="16"></EmpoweredSquare>
        <EmpoweredSquare value="17"></EmpoweredSquare>
        <EmpoweredSquare value="18"></EmpoweredSquare>
        <Square value="19"></Square>
        <Square value="20"></Square>
      </div>
      <div className='boardLine'>
        <Square value="21"></Square>
        <Square value="22"></Square>
        <EmpoweredSquare value="23"></EmpoweredSquare>
        <CoreSquare value="24"></CoreSquare>
        <EmpoweredSquare value="25"></EmpoweredSquare>
        <Square value="26"></Square>
        <Square value="27"></Square>
      </div>
      <div className='boardLine'>
        <Square value="28"></Square>
        <Square value="29"></Square>
        <EmpoweredSquare value="30"></EmpoweredSquare>
        <EmpoweredSquare value="31"></EmpoweredSquare>
        <EmpoweredSquare value="32"></EmpoweredSquare>
        <Square value="33"></Square>
        <Square value="34"></Square>
      </div>
      <div className='boardLine'>
        <Square value="35"></Square>
        <Square value="36"></Square>
        <Square value="37"></Square>
        <Square value="38"></Square>
        <Square value="39"></Square>
        <Square value="40"></Square>
        <Square value="41"></Square>
      </div>
      <div className='boardLine'>
        <Square value="42"></Square>
        <Square value="43"></Square>
        <Square value="44"></Square>
        <Square value="45"></Square>
        <Square value="46"></Square>
        <Square value="47"></Square>
        <Square value="48"></Square>
      </div>
    </div>
  )
}
function TokenSetUp(){
return(
  <div>
    <Token></Token>
  </div>
)
}

function Square(value, type){
  return(
    <button className="square"></button>
    );
}
function EmpoweredSquare(value, type){
  return(
    <button className="empoweredSquare"></button>
    );
}
function CoreSquare(value, type){
  return(
    <button className="coreSquare"></button>
    );
}

function Token(){
  return(
    <button className="token"></button>
    );
}
function Game() {
  return(
      <Board></Board>

  )
}

export default Game;
